import React from 'react';
import Song from './Song';
import Podcast from './Podcast';

const Playlist = () => {
  const songs = [
    { title: 'Song 1', artist: 'Artist 1', year: 2021 },
    { title: 'Song 2', artist: 'Artist 2', year: 2022 },
    { title: 'Song 3', artist: 'Artist 3', year: 2023 },
  ];

  const podcasts = [
    { season: 1, episode: 1, episodeTitle: 'Episode 1' },
    { season: 1, episode: 2, episodeTitle: 'Episode 2' },
    { season: 2, episode: 1, episodeTitle: 'Episode 1' },
  ];

  return (
    <div>
      <h2>Songs:</h2>
      {songs.map((song, index) => (
        <Song key={index} {...song} />
      ))}

      <h2>Podcasts:</h2>
      {podcasts.map((podcast, index) => (
        <Podcast key={index} {...podcast} />
      ))}
    </div>
  );
};

export default Playlist;
